// ==UserScript==
// @name         推特自动翻译
// @namespace    http://tampermonkey.net/
// @version      1.0.1
// @description  自动翻译帖子，回答，推特敏感视频会隐藏，该脚本能够自动解除隐藏，自动开声音
// @author       shiqigong--bilibili
// @match        *://*.x.com/*
// @icon         data:image/gif;base64,
// @grant        GM.xmlHttpRequest
