// @downloadURL https://update.greasyfork.org/scripts/540629/%E6%8E%A8%E7%89%B9%E8%87%AA%E5%8A%A8%E7%BF%BB%E8%AF%91.user.js
// @updateURL https://update.greasyfork.org/scripts/540629/%E6%8E%A8%E7%89%B9%E8%87%AA%E5%8A%A8%E7%BF%BB%E8%AF%91.meta.js
// ==/UserScript==

(function() {
    'use strict';
    // 首页点击show
    var class_name1 = 'css-175oi2r r-sdzlij r-1phboty r-rs99b7 r-lrvibr r-173mn98 r-1s2bzr4 r-15ysp7h r-4wgw6l r-3pj75a r-1loqt21 r-o7ynqc r-6416eg r-1ny4l3l'
    // 人物media点击show
    var class_name2 = 'css-146c3p1 r-bcqeeo r-qvutc0 r-37j5jr r-a023e6 r-rjixqe r-16dba41 r-1loqt21 r-fdjqy7'
    // 人物主页点击显示
    var class_name3 = 'css-175oi2r r-sdzlij r-1phboty r-rs99b7 r-lrvibr r-k200y r-1j93nrh r-1mnahxq r-19yznuf r-64el8z r-1fkl15p r-1loqt21 r-o7ynqc r-6416eg r-1ny4l3l'
    // 这个是帖子内容的类名
    var class_name4 = "css-146c3p1 r-bcqeeo r-1ttztb7 r-qvutc0 r-37j5jr r-a023e6 r-rjixqe r-16dba41 r-bnwqim"
    // 这是进入帖子的帖子的类名
    var class_name4_2 =  "css-146c3p1 r-bcqeeo r-1ttztb7 r-qvutc0 r-37j5jr r-1inkyih r-16dba41 r-bnwqim r-135wba7"
                        
    // 这个是帖子每个span的类名
    var class_name5 = "css-1jxf684 r-bcqeeo r-1ttztb7 r-qvutc0 r-poiln3"

    const observer = new MutationObserver(function(mutations) {
        click_show();
        open_sound();
        translate_text();
    });

    observer.observe(document.body, {
        childList: true,
        subtree: true
    });


    function click_show(){
        EachContent(document.getElementsByClassName(class_name1),(item)=>{item.click();})
        EachContent(document.getElementsByClassName(class_name2),(item)=>{item.click();})
        EachContent(document.getElementsByClassName(class_name3),(item)=>{item.click();})
    }

    function open_sound(){
        EachContent(document.getElementsByTagName("video"),(item)=>{item.muted = false;})
    }

    function EachContent(list,target){
        for(let i = 0; i < list.length; i++){
            target(list[i])
        }
    }

    function get_post_div_list(){
        var post_div_list = document.getElementsByClassName(class_name4)
        var post_div_list_2 = document.getElementsByClassName(class_name4_2)
        var new_post_div_list = []
        EachContent(post_div_list,(item)=>{
            if(!item.getElementsByClassName("translate").length && !item.getElementsByClassName("translating").length){
                item.appendChild(create_div("translating"))
                new_post_div_list.push(item)
            }
        })
        EachContent(post_div_list_2,(item)=>{
            if(!item.getElementsByClassName("translate").length && !item.getElementsByClassName("translating").length){
                item.appendChild(create_div("translating"))
                new_post_div_list.push(item)
            }
        })
        return new_post_div_list
    }

    function get_post_text_list(){
        let post_text_list = []
        EachContent(get_post_div_list(),(item)=>{
            let i = item.getElementsByClassName(class_name5)
            let b = []
            EachContent(i,(item2)=>{
                if(!item2.className.includes("r-1loqt21"))
                b.push(item2.innerText)
            })
            post_text_list.push({
                'item':item,
                'text':b.join('\n')
            })
        })
        return post_text_list
    }

    async function translate_text(){
        let post_text_list = get_post_text_list()
        for(let item of post_text_list){
            let translate_obj = await translate(item.item,item.text);
            if(!translate_obj){
                continue;
            }
            if(translate_obj.is_translate){
                append_translate_text(item,translate_obj.result)
            }
        }
    }

    function append_translate_text(dom_node,translate_txt){
        if(dom_node.text===translate_txt) return
        console.log('translate_txt:',translate_txt)
        console.log('dom node text:',dom_node.text)
        dom_node = dom_node.item
        translate_txt = translate_txt.replaceAll("https://",'')
        translate_txt = translate_txt.replaceAll("https：//",'')
        let new_dom = dom_node.cloneNode(true)
        new_dom.appendChild(create_div("translate"))
        let translate_list = translate_txt.split('\n')
        let span_list = new_dom.getElementsByClassName(class_name5)
        EachContent(span_list,(item2)=>{
            if(!item2.className.includes("r-1loqt21")){
                let num = item2.innerText.split('\n').length
                let new_InnerText = translate_list.splice(0,num).join('\n')
                item2.innerText = new_InnerText
            }
        })
        dom_node.appendChild(translate_span_txt())
        dom_node.innerHTML += new_dom.innerHTML
    }

    function is_url(str){
        return /^(?=^.{3,255}$)(http(s)?:\/\/)?(www\.)?[a-zA-Z0-9][-a-zA-Z0-9]{0,62}(\.[a-zA-Z0-9][-a-zA-Z0-9]{0,62})+(:\d+)*(\/\w+\.\w+)*$/.test(str)
    }

    function is_UserName(str){
        return /^@[a-zA-Z0-9_]{1,15}$/.test(str)
    }

    function create_div(className=null,text=null){
        let div = document.createElement("div")
        if(className){
            div.setAttribute("class", className)
        }
        if(text){
            div.innerText = text
        }
        return div
    }

    function translate_span_txt(){
        let span = document.createElement("span")
        span.setAttribute("class", class_name5)
        span.innerText = "\n😘翻译结果✔：\n"
        return span
    }


    async function gettype(query){
        let headers = {
            'Accept': '*/*',
            'Accept-Language': 'zh-CN,zh;q=0.9,en;q=0.8,en-GB;q=0.7,en-US;q=0.6',
            'Cache-Control': 'no-cache',
            'Connection': 'keep-alive',
            'Content-Type': 'application/x-www-form-urlencoded',
            'Origin': 'https://fanyi.baidu.com',
            'Pragma': 'no-cache',
            'Referer': 'https://fanyi.baidu.com/mtpe-individual/multimodal',
            'Sec-Fetch-Dest': 'empty',
            'Sec-Fetch-Mode': 'cors',
            'Sec-Fetch-Site': 'same-origin',
            'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/138.0.0.0 Safari/537.36 Edg/138.0.0.0',
            'sec-ch-ua': '"Not)A;Brand";v="8", "Chromium";v="138", "Microsoft Edge";v="138"',
            'sec-ch-ua-mobile': '?0',
            'sec-ch-ua-platform': '"Windows"',
        }

        

        return new Promise((resolve, reject) => {
            GM.xmlHttpRequest({
                url: 'https://fanyi.baidu.com/langdetect',
                method: 'POST',
                headers: headers,
                data: 'query=' + encodeURIComponent(query),
                onload: function(res) {
                    if (res.status === 200) {
                        resolve(res.responseText);
                    } else {
                        reject("HTTP error: " + res.status);
                    }
                },
                onerror: function(err) {
                    reject(err);
                }
            });
        }).then((text)=>{
            let res = JSON.parse(text);
            return res.lan
        });
    }

    async function get_translate(query,lan){
        let headers = {
            'Accept-Language': 'zh-CN,zh;q=0.9,en;q=0.8,en-GB;q=0.7,en-US;q=0.6',
            'Cache-Control': 'no-cache',
            'Connection': 'keep-alive',
            'Content-Type': 'application/json',
            'Origin': 'https://fanyi.baidu.com',
            'Pragma': 'no-cache',
            'Sec-Fetch-Dest': 'empty',
            'Sec-Fetch-Mode': 'cors',
            'Sec-Fetch-Site': 'same-origin',
            'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/138.0.0.0 Safari/537.36 Edg/138.0.0.0',
            'accept': 'text/event-stream',
            'sec-ch-ua': '"Not)A;Brand";v="8", "Chromium";v="138", "Microsoft Edge";v="138"',
            'sec-ch-ua-mobile': '?0',
            'sec-ch-ua-platform': '"Windows"',
        }


        let json_data = {
            'query': query,
            'from': lan,
            'to': 'zh',
            'reference': '',
            'corpusIds': [],
            'needPhonetic': true,
            'domain': 'common',
            'milliTimestamp': Date.now(),
        }


        return new Promise((resolve, reject) => {
            GM.xmlHttpRequest({
                url: 'https://fanyi.baidu.com/ait/text/translate',
                method: 'POST',
                headers: headers,
                data: JSON.stringify(json_data),
                onload: function(res) {
                    resolve(res.responseText);
                },
                onerror: function(err) {
                    reject(err);
                }
            });
        });
    }

    function parse_result(res){
        let result = []
        for(let obj of res){
            if(result.length == 0){
                result.push(obj)
            }else{
                if(result[result.length-1].type == obj.type || obj.type=='*'){
                    result[result.length-1].query = result[result.length-1].query + '\n' + obj.query
                }else{
                    result.push(obj)
                }
            }
        }
        return result
    }

    function parse_result_2(res){
        const translate_status_event = 'Translating'
        let str1 = res.split('\n\n')
        let obj;
        for(let i=0;i<str1.length;i++){
            let str2 = str1[i].split('data:')
            let str3 = str2[str2.length-1]
            obj = JSON.parse(str3)
            if(obj.data.event===translate_status_event){
                break
            }
        }
        try{
            let result = []
            for(let i of obj.data.list){
                result.push(i.dst)
            }
            return result.join('\n')
        }catch(e){
            return obj.data.dst
        }
    }

    async function translate(item,text){
        let is_translate = false
        let query_list = String(text).split('\n')
        let _query = []
        for(let _ of query_list){
            
            if(_.trim() === ''){
                _query.push({
                    'query':_,
                    'type':'*'
                })
            }else if(is_url(_.replace('\n',''))){
                _query.push({
                    'query':_,
                    'type':'url'
                })
            }else if(is_UserName(_)){
                _query.push({
                    'query':_,
                    'type':'username'
                })
            }else if(filter(_)){
                _query.push({
                    'query':_,
                    'type':'zh'
                })
            }else{
                if(!document.documentElement.contains(item)){
                    return false
                }
                await gettype(_).then(res => {
                    _query.push({
                        'query': _,
                        'type': res
                    })
                })
            }
        }
        let end_query = parse_result(_query)
        let result = []
        for(let i = 0; i < end_query.length; i++){
            let query = end_query[i]['query']
            let type = end_query[i]['type']
            if(type=='zh' || type=='*' || type=='url' || type=='username'){
                result.push(query)
            }else{
                if(!document.documentElement.contains(item)){
                    return false
                }
                await get_translate(query, type).then(res => {
                    let _ = parse_result_2(res)
                    if(_.includes(query)){
                        result.push(query)
                    }else{
                        is_translate = true
                        result.push(_)
                    }
                })
            }
        }
        let obj = {result:result.join('\n'),is_translate:is_translate}
        return obj
    }

    function filter_query(str){
        return /^[：:～&①…＼／【】「」（）\[\]]$/.test(str.trim()) || /^https?:\/\//.test(str.trim())
    }

    function filter_chinese(str){
        return /^[\u4e00-\u9fa5\u3002\uff1f\uff01\uff0c\uff1b\uff1a\u201c\u201d\u2018\u2019\uff08\uff09\uff3b\uff3d\uff5b\uff5d\uff0e\uff1f\uff0c\uff1b\uff1a\u2013\u2014\u2026\u3001\u300c\u300d\u3010\u3011\uff10-\uff190-9\s\n\r\t]+$/.test(str.trim())
    }

    function filter(str){
        return filter_query(str) || filter_chinese(str)
    }

})();